import React, { useEffect } from "react";

export const Home = () => {
  const fetchProduct = () => {
    fetch("https://dummyjson.com/products")
      .then((res) => res.json())
      .then(console.log);
  };

  useEffect(() => {
    fetchProduct();
  }, []);

  return <div>Home</div>;
};
